import React, { useEffect, useState } from 'react';

function App() {
  const [testMessage, setTestMessage] = useState('');

  useEffect(() => {
    fetch(process.env.REACT_APP_BACKEND_URL + '/test' || 'http://localhost:5000/test')
      .then(response => {
        if (!response.ok) {
          throw new Error('Bad response');
        }
        return response.json();
      })
      .then(data => {
        setTestMessage(data.testMessage);
      })
      .catch(err => {
        setTestMessage('FAILED, as something related to fetching backend data is not working :(');
      });
  }, []);

  return (
    <div>
      <h1>Test: {testMessage}</h1>
    </div>
  );
}

export default App;
